import React from 'react';
import "semantic-ui-css/semantic.min.css";

import { Header, Table, Grid } from "semantic-ui-react";

class App extends React.Component {
  render() {
    return (
      <Table definition>
        <Table.Header>
          <Table.Row>
            <Table.HeaderCell rowSpan='4'/>
            <Table.HeaderCell colSpan='3'>Month</Table.HeaderCell>
          </Table.Row>
          <Table.Row>
            <Table.HeaderCell colSpan='3'>Amounts</Table.HeaderCell>
          </Table.Row>
          <Table.Row>
            <Table.HeaderCell colSpan='3'>Overbudgeted</Table.HeaderCell>
          </Table.Row>
          <Table.Row>
            <Table.HeaderCell>Budgeted</Table.HeaderCell>
            <Table.HeaderCell>Spent</Table.HeaderCell>
            <Table.HeaderCell>Balance</Table.HeaderCell>
          </Table.Row>
        </Table.Header>
        <Table.Body>
          <Table.Row>
            <Table.Cell>Groceries</Table.Cell>
            <Table.Cell>200</Table.Cell>
            <Table.Cell>-57.68</Table.Cell>
            <Table.Cell>142.32</Table.Cell>
          </Table.Row>
        </Table.Body>
      </Table>
  //   <Grid>
  //     <Table definition>
  //   <Table.Header>
  //     <Table.Row>
  //       <Table.HeaderCell />
  //       <Table.HeaderCell>Arguments</Table.HeaderCell>
  //       <Table.HeaderCell>Description</Table.HeaderCell>
  //     </Table.Row>
  //   </Table.Header>

  //   <Table.Body>
  //     <Table.Row>
  //       <Table.Cell>reset rating</Table.Cell>
  //       <Table.Cell>None</Table.Cell>
  //       <Table.Cell>Resets rating to default value</Table.Cell>
  //     </Table.Row>
  //     <Table.Row>
  //       <Table.Cell>set rating</Table.Cell>
  //       <Table.Cell>rating (integer)</Table.Cell>
  //       <Table.Cell>Sets the current star rating to specified value</Table.Cell>
  //     </Table.Row>
  //   </Table.Body>
  // </Table>
  // </Grid>
    );
  }
}

export default App;
